import React, { useState } from 'react'
import { Link, useNavigate } from 'react-router-dom'
import { ToastContainer } from 'react-toastify';
import { handleError, handleSuccess } from '../utils';

function Signup() {
    const [signupInfo, setSignupInfo] = useState({
        firstName: '',
        lastName: '',
        email: '',
        password: '',
        reEnterPassword: '',
        phoneNumber: '',
        dateOfBirth: '',
        gender: '',
        agreement: false
    });

    const navigate = useNavigate();
    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        const copySignupInfo = { ...signupInfo };
        copySignupInfo[name] = type === 'checkbox' ? checked : value;
        setSignupInfo(copySignupInfo);
    };

    const handleSignup = async (e) => {
        e.preventDefault();
        const { firstName, lastName, email, password, reEnterPassword, phoneNumber, dateOfBirth, gender, agreement } = signupInfo;

        if (!firstName || !lastName || !email || !password || !reEnterPassword || !phoneNumber || !dateOfBirth || !gender || !agreement) {
            return handleError('All fields are required');
        }

        try {
            const url = `http://localhost:8080/auth/signup`;
            const response = await fetch(url, {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(signupInfo)
            });
            const result = await response.json();
            const { success, message, error } = result;
            if (success) {
                handleSuccess(message);
                setTimeout(() => {
                    navigate('/login')
                }, 1000);
            } else if (error) {
                const details = error?.details[0].message;
                handleError(details);
            } else if (!success) {
                handleError(message);
            }
        } catch (err) {
            handleError(err);
        }
    };

    return (
        <div className='container'>
            <h1>Signup</h1>
            <form onSubmit={handleSignup}>
                <div>
                    <label htmlFor='firstName'>First Name</label>
                    <input
                        onChange={handleChange}
                        type='text'
                        name='firstName'
                        autoFocus
                        placeholder='Enter your first name...'
                        value={signupInfo.firstName}
                    />
                </div>
                <div>
                    <label htmlFor='lastName'>Last Name</label>
                    <input
                        onChange={handleChange}
                        type='text'
                        name='lastName'
                        placeholder='Enter your last name...'
                        value={signupInfo.lastName}
                    />
                </div>
                <div>
                    <label htmlFor='email'>Email</label>
                    <input
                        onChange={handleChange}
                        type='email'
                        name='email'
                        placeholder='Enter your email...'
                        value={signupInfo.email}
                    />
                </div>
                <div>
                    <label htmlFor='password'>Password</label>
                    <input
                        onChange={handleChange}
                        type='password'
                        name='password'
                        placeholder='Enter your password...'
                        value={signupInfo.password}
                    />
                </div>
                <div>
                    <label htmlFor='reEnterPassword'>Re-enter Password</label>
                    <input
                        onChange={handleChange}
                        type='password'
                        name='reEnterPassword'
                        placeholder='Re-enter your password...'
                        value={signupInfo.reEnterPassword}
                    />
                </div>
                <div>
                    <label htmlFor='phoneNumber'>Phone Number</label>
                    <input
                        onChange={handleChange}
                        type='text'
                        name='phoneNumber'
                        placeholder='Enter your phone number...'
                        value={signupInfo.phoneNumber}
                    />
                </div>
                <div>
                    <label htmlFor='dateOfBirth'>Date of Birth</label>
                    <input
                        onChange={handleChange}
                        type='date'
                        name='dateOfBirth'
                        value={signupInfo.dateOfBirth}
                    />
                </div>
                <div>
                    <label htmlFor='gender'>Gender</label>
                    <select
                        onChange={handleChange}
                        name='gender'
                        value={signupInfo.gender}
                    >
                        <option value="">Select your gender</option>
                        <option value="male">Male</option>
                        <option value="female">Female</option>
                        <option value="other">Other</option>
                    </select>
                </div>
                <div>
                    <label htmlFor='agreement'>
                        <input
                            onChange={handleChange}
                            type='checkbox'
                            name='agreement'
                            checked={signupInfo.agreement}
                        />
                        I agree to the terms and conditions
                    </label>
                    <button type="button">See more</button>
                </div>
                <button class = "button-tes" type='submit'>Signup</button>
                {/* <div>
                    <button type="button">Signup with Google</button>
                    <button type="button">Signup with Apple</button>
                </div> */}
                <span>Already have an account?
                    <Link to="/login">Login</Link>
                </span>
            </form>
            <ToastContainer />
        </div>
    )
}

export default Signup;
